class CrawlerStatsProxy:
    api_url = 'https://crawler-stats.edited.com/api/v1/unhappy-crawlers'

    def __init__(self, username=None, password=None):
        self.username = username
        self.password = password

    def get_broken_crawlers(self):
        daily_stats = self._scrape_daily_stats()
        return self._parse_broken_crawlers(daily_stats)

    def _scrape_daily_stats(self):
        with requests.Session() as s:
            response = s.get(self.api_url)
            selector = html.fromstring(response.content)
            token = selector.xpath('//input[@name="csrfmiddlewaretoken"]/@value')

            headers = {
                'Content-Type': 'application/x-www-form-urlencoded',
                'User-Agent': 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_5) AppleWebKit/537.36 (KHTML, like Gecko) '
                              'Chrome/50.0.2661.102 Safari/537.36',
                'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8',
                'Accept-Encoding': 'gzip, deflate, br',
                'Referer': response.url,
            }

            form_data = {
                'csrfmiddlewaretoken': token[0],
                'timezone': 'Asia/Karachi',
                'device_id': '',
                'email': self.username,
                'password': self.password
            }

            response = s.post(response.url, headers=headers, data=form_data)
            return json.loads(response.text)

    def _parse_broken_crawlers(self, raw_crawlers):
        broken_crawlers = []
        for crawler in raw_crawlers:
            days_failing = crawler['days_since_happy']
            if isinstance(days_failing, str):
                days_failing = 15

            current_items = int(crawler['most_recent_crawl']['item_scraped_count'])
            average_items = int(crawler['average_scraped'])

            reduction = 100
            if average_items > 0 and current_items > 0:
                reduction = 100 - int(100 * current_items / average_items)

            if reduction < 30 or days_failing < 1:
                continue

            broken_crawler = {
                'days_failing': days_failing,
                'spider_name': crawler['slug'],
                'reduction': reduction,
                'current_items': current_items,
                'average_items': average_items,
                'blocked': crawler['mood'] == 'blocked'
            }

            broken_crawlers.append(broken_crawler)
        return broken_crawlers


def get_broken_from_crawler_stats():
    username = os.environ['CRAWLER_STATS_USERNAME']
    password = os.environ['CRAWLER_STATS_PASSWORD']
    crawler_stats = CrawlerStatsProxy(username, password)
    return crawler_stats.get_broken_crawlers()
